import React, { useState } from 'react';
import './style.css';

function TodoListNext() {
  const [inputValue, setInputValue] = useState('デフォルト文字')

  const isClick = (initialValue = false)=>{
    return useReducer((inputValue) => !inputValue, initialValue);
  }
  return (
    <div>
      {inputValue}
      <br />
      <button className="todoBtn" onClick={()=>{setInputValue('入力！')}}>＋</button>
    </div>
  );
}

export default TodoListNext;
